sbol:ComponentDefinition.addgene:modificationsToBackbone:
The pX856 vector (gift from Feng Zhang, Addgene plasmid #62888) was
modified as follows: the U6 promoter/sgRNA scaffold/U6 terminator cassette was removed; the dCas9(C)VP64 N-terminal NLS+FKBP were also removed; 
a transmembrane tether (TMt) containing the Igκ signal sequence, (GGGS)2 linker, myc epitope tag, PDGF receptor transmembrane domain and the XTEN linker, was synthesized as a gBlock (IDT). This transmembrane tether was then fused to the N-terminus of HA-dCas9(C)VP64 via a TEV cleavage site (ENLYFQG) and NLS. The MCP-P65-HSF1 from plasmid MS2-P65-HSF1_GFP (gift from Feng Zhang, Addgene plasmid #61423) was fused to the C-terminus of dCas9(C)VP64 via at T2A site.
